import axios from "axios";

const userHelper = {
  async deleteUsers(userArray) {
    const response = await axios.post(
      "http://localhost:5000/user-w/delete-users",
      {
        users: userArray,
      },
      {
        withCredentials: true,
      }
    );

    return console.log(response.data);
  },
};

export default userHelper;
